import React, { useState } from 'react';

const mainBg = {
  background: 'linear-gradient(to bottom, #2c466b 60%, #3e5c2c 100%)',
  minHeight: '100vh',
  color: '#fff',
  fontFamily: 'sans-serif',
  padding: '0',
  margin: '0',
};

const cardStyle = {
  background: '#fff',
  color: '#2c466b',
  borderRadius: '10px',
  padding: '10px 20px',
  margin: '10px',
  minWidth: '80px',
  textAlign: 'center',
  fontWeight: 'bold',
  boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
};

const sectionTitle = {
  fontSize: '1.2em',
  fontWeight: 'bold',
  margin: '10px 0 5px 0',
};

function App() {
  const [club, setClub] = useState({
    name: 'BENIDORM',
    season: '2025/26',
    league: 'Tercera C',
    date: 'Ağu 2025',
    hfSonu: 5,
    lig: 5,
    money: 12000,
    kadro: 36,
    menajer: 37,
    antrenman: 37,
    altyapi: 35,
    kupalar: 0,
    basarildi: 1,
    taraftarMutlu: 97,
    baskanMutlu: 52,
    stadium: 'Stadyum',
    baskan: 'Başkan',
    matchResults: ['M', 'G', 'G', 'G', 'B', 'B'],
    nextMatch: 'Tercera C: Guijuelo (D)',
  });

  const [showFixture, setShowFixture] = useState(false);
  const fixtureData = [
    { hft: 0, rakip: 'DON BENITO (E)', a: 1, y: 2, result: 'M', crowd: 194, pos: 'HZR' },
    { hft: 1, rakip: 'ZAMUDIO (D)', a: 1, y: 0, result: 'G', crowd: '-', pos: 5 },
    { hft: 2, rakip: 'LEALTAD (E)', a: 2, y: 0, result: 'G', crowd: 439, pos: 3 },
    { hft: 3, rakip: 'SANTA BRIGIDA (D)', a: 2, y: 2, result: 'B', crowd: '-', pos: 2 },
    { hft: 4, rakip: 'LOJA (E)', a: 1, y: 1, result: 'B', crowd: 390, pos: 5 },
    { hft: 5, rakip: 'GUIJUELO (D)', a: '-', y: '-', result: '', crowd: '-', pos: '-' },
    // ... add more rows as needed
  ];

  const getResultColor = (result) => {
    if (result === 'M') return '#c00';
    if (result === 'G') return '#2c7b2c';
    if (result === 'B') return '#b88c2c';
    return '#ccc';
  };

  return (
    <div style={mainBg}>
      <div style={{padding: '20px 0', textAlign: 'center'}}>
        <div style={{fontSize: '1.5em', fontWeight: 'bold'}}>FOOTBALL CHAIRMAN</div>
        <div style={{margin: '10px auto', display: 'inline-block', background: '#fff', color: '#2c466b', borderRadius: '8px', padding: '5px 30px', fontSize: '2em', fontWeight: 'bold'}}>{club.name}</div>
        <div style={{marginTop: '5px', fontSize: '1em'}}>{club.season} &nbsp;|&nbsp; {club.league} &nbsp;|&nbsp; {club.date}</div>
      </div>
      <div style={{display: 'flex', justifyContent: 'center', flexWrap: 'wrap', gap: '10px'}}>
        <button style={{...cardStyle, cursor: 'pointer'}} onClick={() => setShowFixture(true)}>
          HF SONU<br/><span style={{fontSize: '1.5em'}}>{club.hfSonu}</span>
        </button>
        <div style={cardStyle}>LİG<br/><span style={{fontSize: '1.5em'}}>{club.lig}.</span></div>
        <div style={{...cardStyle, color: '#2c7b2c'}}>PARA<br/><span style={{fontSize: '1.5em', color: '#2c7b2c'}}>€{club.money.toLocaleString()}</span></div>
      </div>
      {/* Fixture Modal */}
      {showFixture && (
        <div style={{position: 'fixed', top: 0, left: 0, width: '100vw', height: '100vh', background: 'rgba(44,70,107,0.95)', zIndex: 1000, display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center'}}>
          <div style={{background: '#fff', color: '#2c466b', borderRadius: '12px', padding: '20px', minWidth: '320px', maxWidth: '90vw', maxHeight: '80vh', overflowY: 'auto', boxShadow: '0 2px 16px rgba(0,0,0,0.2)'}}>
            <div style={{fontSize: '1.3em', fontWeight: 'bold', textAlign: 'center', marginBottom: '10px'}}>FİKSTÜRLER/SONUÇLAR</div>
            <table style={{width: '100%', borderCollapse: 'collapse', fontSize: '1em'}}>
              <thead>
                <tr style={{background: '#e6f4e6'}}>
                  <th style={{padding: '4px'}}>hft</th>
                  <th style={{padding: '4px'}}>Rakip</th>
                  <th style={{padding: '4px'}}>A</th>
                  <th style={{padding: '4px'}}>Y</th>
                  <th style={{padding: '4px'}}>Sonuç</th>
                  <th style={{padding: '4px'}}>Kalabalık</th>
                  <th style={{padding: '4px'}}>Poz</th>
                </tr>
              </thead>
              <tbody>
                {fixtureData.map((row, idx) => (
                  <tr key={idx} style={{background: idx % 2 === 0 ? '#f5f5f5' : '#e6f4e6'}}>
                    <td style={{padding: '4px', textAlign: 'center'}}>{row.hft}</td>
                    <td style={{padding: '4px'}}>{row.rakip}</td>
                    <td style={{padding: '4px', textAlign: 'center'}}>{row.a}</td>
                    <td style={{padding: '4px', textAlign: 'center'}}>{row.y}</td>
                    <td style={{padding: '4px', textAlign: 'center'}}>
                      {row.result && (
                        <span style={{display: 'inline-block', width: '24px', height: '24px', borderRadius: '6px', background: getResultColor(row.result), color: '#fff', fontWeight: 'bold', lineHeight: '24px', textAlign: 'center'}}>{row.result}</span>
                      )}
                    </td>
                    <td style={{padding: '4px', textAlign: 'center'}}>{row.crowd}</td>
                    <td style={{padding: '4px', textAlign: 'center'}}>{row.pos}</td>
                  </tr>
                ))}
              </tbody>
            </table>
            <div style={{display: 'flex', justifyContent: 'space-between', marginTop: '16px'}}>
              <button style={{background: '#3e5c2c', color: '#fff', border: 'none', borderRadius: '6px', padding: '8px 24px', fontWeight: 'bold', fontSize: '1em', cursor: 'pointer'}} onClick={() => setShowFixture(false)}>Geri</button>
              <button style={{background: '#3e5c2c', color: '#fff', border: 'none', borderRadius: '6px', padding: '8px 24px', fontWeight: 'bold', fontSize: '1em', cursor: 'pointer'}}>Tablo</button>
            </div>
          </div>
        </div>
      )}
      <div style={{display: 'flex', justifyContent: 'center', flexWrap: 'wrap', gap: '10px', marginTop: '10px'}}>
        <div style={{...cardStyle, background: '#2c466b', color: '#fff'}}>KADRO<br/>{club.kadro}</div>
        <div style={{...cardStyle, background: '#2c466b', color: '#fff'}}>MENAJER<br/>{club.menajer}</div>
        <div style={{...cardStyle, background: '#2c466b', color: '#fff'}}>ANTRENMAN<br/>{club.antrenman}</div>
        <div style={{...cardStyle, background: '#2c466b', color: '#fff'}}>ALTYAPI<br/>{club.altyapi}</div>
      </div>
      <div style={{display: 'flex', justifyContent: 'center', flexWrap: 'wrap', gap: '10px', marginTop: '10px'}}>
        <div style={{...cardStyle, background: '#3e5c2c', color: '#fff'}}>KUPALAR<br/>{club.kupalar}</div>
        <div style={{...cardStyle, background: '#3e5c2c', color: '#fff'}}>BAŞARILDI<br/>{club.basarildi}</div>
        <div style={{...cardStyle, background: '#3e5c2c', color: '#fff'}}>REKORLAR<br/><span style={{fontSize: '1.2em'}}>🏆</span></div>
        <div style={{...cardStyle, background: '#3e5c2c', color: '#fff'}}>GEÇMİŞ<br/><span style={{fontSize: '1.2em'}}>📈</span></div>
      </div>
      <div style={{display: 'flex', justifyContent: 'center', flexWrap: 'wrap', gap: '10px', marginTop: '10px'}}>
        <div style={{...cardStyle, background: '#e6f4e6', color: '#2c466b'}}>TARAFTARLAR MUTLU MU?<br/><span style={{fontSize: '1.2em'}}>{club.taraftarMutlu}% MENAJER<br/>{club.baskanMutlu}% BAŞKAN</span></div>
        <div style={{...cardStyle, background: '#e6f4e6', color: '#2c466b'}}>STADYUM<br/><span style={{fontSize: '1.2em'}}>⚽</span></div>
        <div style={{...cardStyle, background: '#e6f4e6', color: '#2c466b'}}>BAŞKAN<br/><span style={{fontSize: '1.2em'}}>👔</span></div>
      </div>
      <div style={{display: 'flex', justifyContent: 'center', gap: '10px', marginTop: '20px'}}>
        {club.matchResults.map((result, idx) => {
          let bg = '#b88c2c';
          if (result === 'M') bg = '#c00';
          if (result === 'G') bg = '#2c7b2c';
          return (
            <div key={idx} style={{width: '30px', height: '30px', borderRadius: '50%', background: bg, display: 'flex', alignItems: 'center', justifyContent: 'center', color: '#fff', fontWeight: 'bold'}}>{result}</div>
          );
        })}
      </div>
      <div style={{margin: '30px auto 0 auto', background: '#3e5c2c', color: '#fff', borderRadius: '6px', padding: '10px 0', textAlign: 'center', maxWidth: '300px', fontWeight: 'bold', fontSize: '1.1em'}}>
        {club.nextMatch}
      </div>
    </div>
  );
}

export default App;
